import Button from "../UI/Button";

const AddUser = (props) => {
	return (
		<form>
			<label>Username</label>
			<input type="text" />
			<label>Age(in Years)</label>
			<input type="number" />
			<Button />
		</form>
	);
};

export default AddUser;
